          <td>{Lista.Informacje}</td>
        </tr>
      </Table>
    );
  });

  return (
    <div>
      <div
        data-aos="fade-right"
        data-aos-duration="2000"
        className="hoverable z-depth-5 white"
      >
        <Row>


            <Col s={12} m={8}>
